import React from 'react'
import {Container, Column, Div, Cell, Row} from './layout'
import styled from 'styled-components'

const Title = styled.h1`
  color: ${props => props.theme.colors.darkBlue};
  font-size: 20px;
  font-weoght: bold;
`

const Strana = styled(Div)`
  width: 100%;
  padding-top: 100%;
  background-image: ${props => `url(/strany/${props.image})`};
  background-position: center;
  background-repeat: no-repeat;
  background-size: contain;
`

const Question = ({title, content}) => (
    <Container height="100vh">
        <Column height="100%" style={{backgroundColor: 'red'}}>
            <Title>{title}</Title>
        </Column>
        <button type="button" onClick={() => this.slider.slickNext()}>submit</button>
    </Container>
)

export default Question
